	public List<PDF> GetMediasdata(){
		 String output="";
		 Type listType;
		 		try{
		 			URL  url = new URL(ipaddress+"/media/getMedias");
		 			HttpURLConnection connection = (HttpURLConnection) url.openConnection();
		 			connection.setRequestMethod("GET");
		 			connection.setConnectTimeout(5000);
		 			connection.setRequestProperty("Content-Type", "application/json");
		 			connection.setRequestProperty("Accept", "application/json");
		 			connection.setDoOutput(true);
		 			connection.connect();
		 			Scanner scanner = new Scanner(connection.getInputStream());
		 			while(scanner.hasNext()){
	        output += scanner.next();
	       }
		 			connection.disconnect();
	       scanner.close();
	       GsonBuilder builder = new GsonBuilder();
	       builder.setPrettyPrinting();
	      Gson gson = builder.create();
	       listType= new com.google.gson.reflect.TypeToken<List<PDF>>() {
	       }.getType();
	    List<PDF> data = gson.fromJson(output, listType);
	      // System.out.println(data.get(0).getFilename());
	    System.out.println(data.get(0).getFiledescrption());
	    return data;
		}catch(Exception e){
			e.printStackTrace();
			return null;
		}
	}
public PDF getfile(String id){
	String output="";
	String json="{\"id\":null,\"file\":\"\",\"filetype\":\"application/pdf\",\"uploaded_time\":null,\"description\":null,\"filename\":null,\"size\":0}";
	PDF pdf = new PDF();
	try{
			URL  url = new URL(ipaddress+"/media/getmediafile/"+id);
			HttpURLConnection connection = (HttpURLConnection) url.openConnection();
			connection.setRequestMethod("GET");
			connection.setRequestProperty("Accept", "application/json");
			Scanner scanner = new Scanner(connection.getInputStream());
			while(scanner.hasNext()){
					output += scanner.next();
				}
			scanner.close();
			
			Gson g = new Gson();
			Template template = g.fromJson(output, Template.class);
			System.out.println(template.getFiletype()); //John
			byte[] filedata = new Base64().decode(template.getFile());
			if(filedata==null) {
				System.out.println("error");
			}
		   pdf.setFile(filedata);
		   pdf.setFiletype(template.getFiletype());
			System.out.println();
			
		}catch(Exception ex) {
			System.out.println(ex.toString());
			return null;
		}
	return pdf;
	
	}
